import React from 'react';

function SearchBar() {
  return (
    <div className='container text-center mt-5 mb-5'>
      <h3 className='display-4'>Search <a href='/'><img src="https://cdn.appzaib.com/public/wixware/img/logo-185x50-light.png" alt="Wixware Logo"/></a></h3>
      <form action='/search' method='get' className='mt-4'>
        <div className='form-group'>
          <input type="search" name="keyword" id='keyword' className='pt-4 pb-4 form-control' placeholder='Type something and press Enter to search' autoComplete='off' />
        </div>
      </form>
    </div>
  );
}

export default SearchBar;
